import React, {Component} from 'react' 

//Child Class
export default class MYclass extends Component //[Default Parent class in React Package]
{

    constructor(props)
    {
       super(props);
    }


    //user_Defined_class_functions
    myfun()
    {
        return "This is Myfun Statement"
    }


//JSX
render()
{
    //js_statements
    console.log(this.props)

    

    //Object destructuring 
    var {history,location,match}=this.props

    return(<>
               
               <div className="container p-5">

                        <h1> CLASS COMPONENT IN REACT </h1>

                        { this.myfun() }

                        <br />

                        {match.url}

                        <br />

                        {location.pathname}

                        <br />

                        {history.location.pathname}




                        



               </div>


            </>)
}


}
